CREATE DEFINER=`root`@`yohannpca` PROCEDURE `DEV_UPDATE_priority`(
	IN `_start` TIMESTAMP,
	IN `_end` TIMESTAMP
)
BEGIN
	DECLARE temporaryValue INTEGER;
	DECLARE SUM_conso INTEGER;
	DECLARE SUM_prod INTEGER;
	
	
	
	
	CALL `generate_hourly_table`(_start, _end);
	
	
	FOR voieDate IN (SELECT hour_start FROM hourly_table) 
	
	DO
		SET @int_1 = voieDate.hour_start;
		SET @int_2 = DATE_FORMAT(DATE_SUB(voieDate.hour_start, INTERVAL -1 HOUR), '%Y-%m-%d %H:00:00');
		FOR voie1 IN (SELECT ID FROM maison )
		DO
			DROP TEMPORARY TABLE IF EXISTS objectsValues;
			CREATE TEMPORARY TABLE objectsValues (valeurConso INT, valeurProd INT);
			SET @temporaryValue = 0;
			SET @SUM_conso = 0;
			SET @SUM_prod = 0;
	
			FOR voie2 IN (SELECT ID FROM objets WHERE ID_MAISON = voie1.ID AND TYPE = "CONSO" )
			DO
				#SELECT voie2.ID;
		    	SELECT SUM(VALEUR) INTO temporaryValue
				FROM mesures
				WHERE (HORODATAGE BETWEEN @int_1 AND @int_2) AND ID_OBJETS = voie2.ID;
		   	INSERT INTO objectsValues (valeurConso) VALUE (temporaryValue);
		   	
			END FOR;
			FOR voie3 IN (SELECT ID FROM objets WHERE ID_MAISON = voie1.ID AND TYPE = "PROD" )
			DO
			
				#SELECT voie3.ID;
		    	SELECT SUM(VALEUR) INTO temporaryValue
				FROM mesures
				WHERE (HORODATAGE BETWEEN @int_1 AND @int_2) AND ID_OBJETS = voie3.ID;
		   	INSERT INTO objectsValues (valeurProd) VALUE (temporaryValue);
			
			END FOR;
			SELECT COALESCE(SUM(valeurConso), 0) INTO SUM_conso
			FROM objectsValues;
			SELECT COALESCE(SUM(valeurProd), 0) INTO SUM_prod
			FROM objectsValues;
			#SELECT * FROM  objectsValues;
			INSERT INTO conso_maison ( ID_MAISON, HORODATAGE, CONSO, PROD) VALUES (voie1.ID , @int_2, SUM_conso, SUM_prod);
			#SELECT * from conso_maison;
		
		END FOR;
	
	END FOR;
	
END ;;
DELIMITER ;
