CREATE DEFINER=`root`@`%` PROCEDURE `generate_hourly_table`(
	IN `start_date` TIMESTAMP,
	IN `end_date` TIMESTAMP
)
BEGIN

   SET @current_date = start_date;
  	 DROP TEMPORARY TABLE IF EXISTS  hourly_table;
    CREATE TEMPORARY TABLE IF NOT EXISTS hourly_table (
        hour_start TIMESTAMP,
        hour_end TIMESTAMP
    );
    
    WHILE @current_date <= end_date DO
        INSERT INTO hourly_table (hour_start, hour_end)
        VALUES (@current_date, @current_date + INTERVAL 1 HOUR);
        
        SET @current_date = @current_date + INTERVAL 1 HOUR;
    END WHILE;
    
    SELECT * FROM hourly_table;
END ;;
DELIMITER ;
