CREATE DEFINER=`root`@`yohannpca` PROCEDURE `GET_objet_mesures`(
	IN `_nom` VARCHAR(50)
)
BEGIN
	SET @PREVIOUS = DATE_FORMAT(DATE_SUB(NOW(), INTERVAL 1 DAY), '%Y-%m-%d 23:59:59');
	SET @NOW = DATE_FORMAT(NOW(),'%Y-%m-%d 23:59:59'); 

	
	FOR voie1 IN (SELECT ID FROM objets WHERE NOM = _nom) 
	DO
	
		SELECT * FROM mesures WHERE ID_OBJETS = voie1.ID AND 	(HORODATAGE BETWEEN @PREVIOUS AND @NOW);
		
	END FOR;
END ;;
